class Solution {

    /**
     * @param Integer[] $nums
     * @return Integer
     */
    function numberOfGoodSubarraySplits($nums) {
        $mod = 1000000007;
        $prefixSum = [0];
        foreach ($nums as $num) {
            $prefixSum[] = $prefixSum[sizeof($prefixSum) - 1] + $num;
        }

        $totalCount = 0;
        for ($i = 1; $i < sizeof($prefixSum); ++$i) {
            if ($prefixSum[$i] - $prefixSum[0] == 1) {
                $totalCount += ($prefixSum[sizeof($prefixSum) - 1] - $prefixSum[$i]);
            }
        }

        return $totalCount % $mod;
    }
}
